package configuracion;

public class MenuItem {
	
	private String item = "";
	private String url = "";
	
	public MenuItem() {
		// TODO Auto-generated constructor stub
	}
	
	public String getItem() {
		return item;
	}
	public void setItem(String item) {
		this.item = item;
	}
	public String getUrl() {
		return url;
	}
	public void setUrl(String url) {
		this.url = url;
	}
}